import React from 'react';
import './Navbar.css';
import logo from '../Assets/Home_icon.png';
const Navbar = () => {
    return (
       <div className="navbar">
           <div className="navbar-logo">
               <img src={logo} alt="logo" height="100px"/>
               <p>Home</p>
           </div>
           <ul className="navbar-links">
                <li>Admin Portal</li>
                <li>Cart</li>
                <li>Bill</li>
           </ul>
       </div>
    );
    }

export default Navbar;
